//import './App.css';
import React from 'react'
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";

/////////////////////////////////////////////////////// M-ui
import { makeStyles } from '@material-ui/core/styles';
import Paper from '@material-ui/core/Paper';
import Grid from '@material-ui/core/Grid';

/////////////////////////////////////////////////////// File
import Navbar from '../../LayUot/Navbar'

/////////////////////////////////////////////////////// Path Component
import Search from './Search'
//import Information from './Inofrmation'
//import Add from './Add'
//import Out from './Out'
//import History from './History'


const useStyles = makeStyles((theme) => ({
  root: {
    flexGrow: 1,
    margin: '10px'
  },
  Navbar: {
    padding: theme.spacing(6),
    textAlign: 'center',
    color: theme.palette.text.secondary,
  },
  Footer: {
    padding: theme.spacing(6),
    textAlign: 'center',
    color: theme.palette.text.secondary,
  },
  PaperL: {
    padding: theme.spacing(1),
    height: 600 ,
    textAlign: 'center',
    color: theme.palette.text.secondary,
  },
  PaperR: {
    padding: theme.spacing(1),
    height: 600 ,
    textAlign: 'center',
    color: theme.palette.text.secondary,
  }
}));


function Dasboard() {
  const classes = useStyles();

  return (
    <Router>
      <div className="App">
        <div className={classes.root}>
          <Grid container spacing={3}>
            <Grid item xs={12}>
              <Paper className={classes.Navbar}>
                <h1>Facility Store</h1>
              </Paper>
            </Grid>
            <Grid item xs={3}>
            <Paper className={classes.PaperR}>
              <Link to="/Search">Search</Link>
              <Link to="/Information">Information</Link>
              <Link to="/Add">Add</Link>
              <Link to="/Out">Out</Link>
              <Link to="/History">History</Link>
            </Paper>
            </Grid>
            <Grid item xs={9}>
              <Paper className={classes.PaperL}>
                  <Switch>
                    Route
                    <Route path="/Search" >       <Search/>       </Route>
                    <Route path="/Information" >  <Information/>  </Route>
                    <Route path="/Add" >          <Add/>          </Route>
                    <Route path="/Out" >          <Out/>          </Route>
                    <Route path="/History" >       <History/>     </Route>
                  </Switch>
              </Paper>
            </Grid>
            <Grid item xs={12}>
              <Paper className={classes.Footer}>
                Footer
              </Paper>
            </Grid>
          </Grid>
        </div>
      </div>
    </Router>
  );
}

function SearchA() {
  return (
    <div>
      <h2>Search</h2>
    </div>
  );

}
function Add() {
  return (
    <div>
      <h2>Add</h2>
    </div>
  );

}
function Out() {
  return (
    <div>
      <h2>Out</h2>
    </div>
  );

}
function Information() {
  return (
    <div>
      <h2>Information</h2>
    </div>
  );

}
function History() {
  return (
    <div>
      <h2>History</h2>
    </div>
  );

}

export default Dasboard;
